window.bookSummaryJSON = "<p>Chief Roach has merged with an alien mech - but can he control its power? </p> <p>Harnessing alien tech was the only way to counter the power of the quadruped mechs piloted by the Quatro. Except Roach's awesome new weapon is like a sword with no hilt, and it seems to be doing everything it can to fragment his psyche. </p> <p>Roach must lead Oneiri Team across an Eresos engulfed by the fires of war. Their mission is to stop the legions of Quatro from laying waste to what remains of humanity's colonies. </p> <p>If Roach can't resist the alien mech's promises of glory and chaos, there will be a meltdown - not just for Oneiri Team, but for everyone on the planet. </p>"; 
